import React from "react";
import ReactDOM from "react-dom";
import "./LandingPage.css";

class LandingPage extends React.Component {
  render() {
    return (
      <div>
        <div className="jumbotron">
          <div className="main-name">
            <h1>Nick Bombicino</h1>
          </div>
        </div>

        <p className="intro-bio">
          Hi! I'm used to writing bios in the third person, a la theatrical
          playbill, but here goes:
          <br />
          <br />
          I'm a budding developer, actor, and musicion based in Brooklyn, NY.
          Aside from my life as a performer and writer, I've spent my time
          designing websites through other platforms and learning foreign
          languages, so I decided it was time to learn another one and start
          designing from scratch. Also - I grew up in the wilds of Vermont,
          surrounded by trees and cows, and yes, I can subside on a diet of
          Maple Syrup alone.
        </p>
      </div>
    );
  }
}

export default LandingPage;
